    return(
        <button>{props.name}</button>
    )
}

const Feedback = () =>{
    //Feedback component containing title and buttons
    return(
        <div>
            <h1>Give feedback</h1>
            <Button name="Good" />
            <Button name="Neutral" />
            <Button name="Bad" />
        </div>
    )

}

